import React from "react";
import {Link} from "react-router-dom";
import "./Header.css";

function Header() {
  return (
    <div className="header">
      <nav class="navbar sticky-top bg-light">
        <div class="container-fluid">
            <a class="navbar-brand" >Sticky top</a>
        </div>
        </nav>
    </div>
  );
}
export default Header;
